import * as React from "react";
import PropTypes from "prop-types";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import CssBaseline from "@mui/material/CssBaseline";
import Divider from "@mui/material/Divider";
import Drawer from "@mui/material/Drawer";
import IconButton from "@mui/material/IconButton";
import InboxIcon from "@mui/icons-material/MoveToInbox";
import List from "@mui/material/List";
import ListItem from "@mui/material/ListItem";
import ListItemIcon from "@mui/material/ListItemIcon";
import ListItemText from "@mui/material/ListItemText";
import MailIcon from "@mui/icons-material/Mail";
import MenuIcon from "@mui/icons-material/Menu";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";

import Jomez from "./images/jomez.png";
import GateKeeper from "./images/gatekeeper.png";
import Acerunpro from "./images/acerunpro.png";
import GKpro from "./images/gkpro.webp";

import OndemandVideoIcon from "@mui/icons-material/OndemandVideo";

const drawerWidth = 240;

const App = (props) => {
  const { window } = props;
  const [mobileOpen, setMobileOpen] = React.useState(false);

  const handleDrawerToggle = () => {
    setMobileOpen(!mobileOpen);
  };

  const PRIMARY = "#053c5e";
  const SECONDARY = "#db222a";

  const drawer = (
    <div>
      <Toolbar />
      <Divider />
      <List>
        <ListItem>
          <Typography variant="h5">Channels</Typography>
        </ListItem>
        <ListItem button key="jomez">
          <img
            src={Jomez}
            alt="Jomez Pro"
            style={{ width: "20%", height: "auto", margin: "5px" }}
          ></img>
          <ListItemText primary="Jomez Productions" />
        </ListItem>
        <ListItem button key="gatekeeper">
          <img
            src={GateKeeper}
            alt="GateKeeper"
            style={{ width: "20%", height: "auto", margin: "5px" }}
          ></img>
          <ListItemText primary="GateKeeper Media" />
        </ListItem>
        <ListItem button key="acerun">
          <img
            src={Acerunpro}
            alt="Ace Run Pro"
            style={{ width: "20%", height: "auto", margin: "5px" }}
          ></img>
          <ListItemText primary="Ace Run Productions" />
        </ListItem>
        <ListItem button key="gk">
          <img
            src={GKpro}
            alt="GK Pro"
            style={{ width: "30%", height: "auto", margin: "5px" }}
          ></img>
          <ListItemText primary="GK Pro" />
        </ListItem>
      </List>
    </div>
  );

  const header = (
    <AppBar
      position="fixed"
      sx={{
        width: { sm: `calc(100% - ${drawerWidth}px)` },
        ml: { sm: `${drawerWidth}px` },
        background: `${PRIMARY}`,
      }}
    >
      <Toolbar>
        <IconButton
          color="inherit"
          aria-label="open drawer"
          edge="start"
          onClick={handleDrawerToggle}
          sx={{ mr: 2, display: { sm: "none" } }}
        >
          <MenuIcon />
        </IconButton>
        <OndemandVideoIcon fontSize="large" sx={{ color: `${SECONDARY}` }} />
        <Typography
          sx={{
            ml: 2,
          }}
          variant="h4"
        >
          Disc Golf Media
        </Typography>
      </Toolbar>
    </AppBar>
  );

  const upcoming = (
    <React.Fragment>
      <Typography
        variant="h5"
        align="center"
        color="textPrimary"
        sx={{
          mt: "40px",
        }}
        gutterBottom
      >
        Past Tournaments
      </Typography>
      <TableContainer component={Paper}>
        <Table sx={{ minWidth: 650 }} aria-label="Past Tournaments">
          <TableHead>
            <TableRow sx={{ backgroundColor: grey[200] }}>
              <TableCell align="center">Start Date</TableCell>
              <TableCell align="center">End Date</TableCell>
              <TableCell align="center">Name</TableCell>
              <TableCell align="center">Location</TableCell>
              <TableCell align="center">Division</TableCell>
              <TableCell align="center">Purse</TableCell>
              <TableCell align="center">Coverage</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            <PopulateTable rows={rows}></PopulateTable>
          </TableBody>
        </Table>
      </TableContainer>
    </React.Fragment>
  );

  const container =
    window !== undefined ? () => window().document.body : undefined;

  return (
    <Box sx={{ display: "flex" }}>
      <CssBaseline />
      {header}
      <Box
        component="nav"
        sx={{ width: { sm: drawerWidth }, flexShrink: { sm: 0 } }}
        aria-label="Channels"
      >
        <Drawer //mobile display
          container={container}
          variant="temporary"
          open={mobileOpen}
          onClose={handleDrawerToggle}
          ModalProps={{
            keepMounted: true, // Better open performance on mobile according to MUI template.
          }}
          sx={{
            display: { xs: "block", sm: "none" },
            "& .MuiDrawer-paper": {
              boxSizing: "border-box",
              width: drawerWidth,
            },
          }}
        >
          {drawer}
        </Drawer>
        <Drawer //large display
          variant="permanent"
          sx={{
            display: { xs: "none", sm: "block" },
            "& .MuiDrawer-paper": {
              boxSizing: "border-box",
              width: drawerWidth,
            },
          }}
          open
        >
          {drawer}
        </Drawer>
      </Box>
      <Box
        component="main"
        sx={{
          flexGrow: 1,
          p: 3,
          width: { sm: `calc(100% - ${drawerWidth}px)` },
        }}
      >
        <Toolbar />
        <Typography paragraph>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
          eiusmod tempor incididunt ut labore et dolore magna aliqua. Rhoncus
          dolor purus non enim praesent elementum facilisis leo vel. Risus at
          ultrices mi tempus imperdiet. Semper risus in hendrerit gravida rutrum
          quisque non tellus. Convallis convallis tellus id interdum velit
          laoreet id donec ultrices. Odio morbi quis commodo odio aenean sed
          adipiscing. Amet nisl suscipit adipiscing bibendum est ultricies
          integer quis. Cursus euismod quis viverra nibh cras. Metus vulputate
          eu scelerisque felis imperdiet proin fermentum leo. Mauris commodo
          quis imperdiet massa tincidunt. Cras tincidunt lobortis feugiat
          vivamus at augue. At augue eget arcu dictum varius duis at consectetur
          lorem. Velit sed ullamcorper morbi tincidunt. Lorem donec massa sapien
          faucibus et molestie ac.
        </Typography>
        <Typography paragraph>
          Consequat mauris nunc congue nisi vitae suscipit. Fringilla est
          ullamcorper eget nulla facilisi etiam dignissim diam. Pulvinar
          elementum integer enim neque volutpat ac tincidunt. Ornare suspendisse
          sed nisi lacus sed viverra tellus. Purus sit amet volutpat consequat
          mauris. Elementum eu facilisis sed odio morbi. Euismod lacinia at quis
          risus sed vulputate odio. Morbi tincidunt ornare massa eget egestas
          purus viverra accumsan in. In hendrerit gravida rutrum quisque non
          tellus orci ac. Pellentesque nec nam aliquam sem et tortor. Habitant
          morbi tristique senectus et. Adipiscing elit duis tristique
          sollicitudin nibh sit. Ornare aenean euismod elementum nisi quis
          eleifend. Commodo viverra maecenas accumsan lacus vel facilisis. Nulla
          posuere sollicitudin aliquam ultrices sagittis orci a.
        </Typography>
      </Box>
    </Box>
  );
};

export default App;
